import React from 'react';

class GenericNotFound extends React.Component{


    render(){
        
        return (<div>
             <style type="text/css">
            {`.navbar {display: none}`}
            </style>
            
            <h1>404</h1>
            <h2>Not Found!</h2>
            
        </div>)
    }

}

export default GenericNotFound;
